    let [getData,update]=useState(H_SData);

    return(

        <>
        
         {
             getData.map((val)=>{
             const {id,Que,Ans}= val;
             return
                 <Card 
                     key={id} {...val} />
             
         }) 
         } 
        </>
    )
}

